    if (cleanText.endsWith(']')) {
        cleanText = cleanText.substring(0, cleanText.length - 1);
    }

    // 2. Normalize the separator using a powerful regex.
    // This looks for a closing brace '}' followed by ANY non-brace characters 
    // (including backticks, newlines, commas, etc.) followed by an opening brace '{'
    // and replaces all the junk in between with a clean '}|||{' delimiter.
    cleanText = cleanText.replace(/}\s*[^}{]*\s*{/g, '}|||{');

    // 3. Split the cleaned string by the new delimiter
    const parts = cleanText.split('|||');

    // 4. Parse each part individually and push it to the array
    for (let part of parts) {
