    // 5. Output the successfully parsed data
    outputItems.push({
        json: {
            validEvaluationData: validJsonData
        }
    });

} catch (e) {
    // Global error handling remains the same
    console.error("Global JSON Error:", e.message);

    let errorContext = '';
    if (typeof cleanText !== 'undefined' && e.position) {
         errorContext = cleanText.substring(Math.max(0, e.position - 50), e.position + 50);
